import { style } from "../InitialPage.module.scss";

const BoxesMenuItem = () => {
  return (
    <div>
      <div className={style.menu}>
        <div className={style.item}>
          <div className={style.img}>
            <img src="" alt="" />
          </div>
          <div className={style.text}>
            <p>Learn cards</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export { BoxesMenuItem };
